import React from 'react';
import './Marker.scss';

import marker from '../../../Assets/Images/pin.png'

const style = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        width: '18px',
        height: '18px',
        backgroundColor: '#000',
        border: '2px solid #fff',
        borderRadius: '100%',
        userSelect: 'none',
        transform: 'translate(-50%, -50%)',
}

const Marker = (props: any) => {
    const { color, name, id } = props;
    return (
      <div className="marker"
        style={{ style}}
        title={name}
      />
    );
  };

  export default Marker;
